import React from "react";
import * as TABLE from "../../dashboards/styles/table.styles";
const QualificationInfo = ({ isQualificData }) => {
  console.log("isQualificData", isQualificData);
  return (
    <React.Fragment>
      <div className="clearfix px-6 pb-6">
        <TABLE.TableWrapper>
          <TABLE.TableTR>
            <TABLE.TableTh>Date</TABLE.TableTh>
            <TABLE.TableTh>Course Name</TABLE.TableTh>
            <TABLE.TableTh>Semester</TABLE.TableTh>
            <TABLE.TableTh>Section</TABLE.TableTh>
            <TABLE.TableTh>Attendance Status</TABLE.TableTh>
          </TABLE.TableTR>

          {!nonAttenData && <PulseLoader size="10" color="#3aafa9" />}

          <TABLE.TableTR>
            <TABLE.TableTd>
              {nonAttenData?.dates &&
                nonAttenData.dates.map((date) => <span>{date}</span>)}
            </TABLE.TableTd>
          </TABLE.TableTR>
        </TABLE.TableWrapper>
      </div>
    </React.Fragment>
  );
};

export default QualificationInfo;
